import { createWebHistory, createRouter } from "vue-router";
import Login from "./pages/LoginPage.vue";
import first from "./pages/firstPage.vue";

const routes=[
    {
        path:"/login",
        component:Login,
    },
    
    {
        path:"/",
        component: first,
    }
]
    

const router = createRouter({
    history:createWebHistory(),
    routes
});

export default router
